import React from 'react';

const Inventory = () => {
    const handleAddProduct =() => {
        fetch('http://localhost:5000/addProducts')
    }
    
    return (
        <div>
         <button onClick={handleAddProduct} >Add Product</button>
        </div>
    );
};

export default Inventory;
